English | CBZ | 28 Pages

Legion of Super-Heroes v4 #36
Publisher:  DC Comics
Publication Date:  November 1992

Writers:  Keith Giffen, Tom Bierbaum, and Mary Bierbaum
Pencillers:  Keith Giffen and Jason Pearson
Inker:  Karl Story
Letterer:  John Workman
Colorist:  Tom McCraw
Cover:  Jason Pearson, Karl Story, and Tom McCraw
Editors:  Michael Eury and Eddie Berganza

The adult Legion and their young counterparts try to figure out which Legion is the genuine article. Bounty and Sade have a fight to the death, revealing Bounty as an entity that had possessed its host.

Thanks goes to DobisP.R. for this release.

